import { Line }from 'react-chartjs-2';
import CharStats from './CharStats';

const ActualLineChart = () => {
    const data = CharStats
    return( 
    <div>
        <Line
            data = {data}
            height={400}
            width={600}
            options= {{
                maintainAspectRatio: false,

            }}
        />
    </div>
    )
}

export default ActualLineChart
